import React from 'react';
import {
  StyleSheet,
  View, Text } from 'react-native';


export default function PageContainer(props) {
  return (
    <View>
      {props.children}
    </View>
  );
}


const styles = StyleSheet.create({
  container: {
    backgroundColor: '#fff',
  }
});
